import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteIcon from '@material-ui/icons/Delete';

export default function Buttons() {
    return (
        <Button 
            startIcon={
                <DeleteIcon />
            }
        >
            Delete 
        </Button>
    );
}
